import {Navbar, ProfileDetails} from '../../Components'
import { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom'
import axios from 'axios';

export const SingleProfilePage = () => {

    const {id} = useParams();
    const [singleProfile, SetsingleProfile] = useState([])
    console.log(id)

    useEffect (() => {
        (async() => {
            try {
                const {data} = await axios.get(`http://localhost:3500/api/SingleProfile/${id}`)
                console.log(data)
                SetsingleProfile(data)
            } catch (error) {
                console.log(error)
            }
        })()
    }, [id])
    return <>
        <Navbar/>
        <h2>SingleProfilePage</h2>
        <ProfileDetails singleProfile={singleProfile}/>
    </>
};
